sources.styles/blocks/menu.scss:
.menu {
  background-color: $main-color;
  box-sizing: border-box;
  height: 100vh;
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  transform: translateX(-100%);
  transition: transform 0.3s;

  &:target {
    transform: translateX(0);
  }

  &__top {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 20px 18px 20px;
  }

  &__list {
    list-style: none;
    padding: 0;
    margin-top: 132px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }

  &__item {
    margin-bottom: 24px;
    &:nth-child(3) {
      margin-bottom: 32px;
    }
    &:last-child {
      color: $accent-color;
      letter-spacing: 0.02em;
      text-transform: uppercase;
    }
  }

  &__link {
    line-height: 24px;
    text-align: center;
    letter-spacing: -0.01em;
    display: flex;
    align-items: center;
    justify-content: center;
  }

  &__phone {
    display: block;
    margin-right: 8px;
  }
}
